import React , {Component } from 'react';
import {ThemeContext} from '../contexts/ThemeContext';
contextType= ThemeContext

  export default class NavBar extends Component{
   render(){
       
       console.log(this.context)
       return(
        
        <nav>
          <ul>
              <li>Home</li>
              <li>Contact</li>
              <li>About</li>
              
          </ul>

        </nav>


       )
   }



  }
